import React from "react";

export default function OrdersPage() {
  return (
    <div className="max-w-4xl mx-auto px-4 py-6">
      <div className="bg-white rounded-xl border p-6">
        <div className="text-2xl font-extrabold text-indigo-700 mb-4">Đơn hàng của bạn</div>
        <div className="text-gray-600">Đây là trang danh sách đơn hàng (UI demo). Sau khi thanh toán COD thành công sẽ chuyển đến đây.</div>
      </div>
    </div>
  );
}
